import React, { useState } from "react";
import mycontext from "./mycontext";

const myprovider = ({ children }) => {
    const [data, setdata] = useState("");
   
    return(
        <mycontext.Provider value={{data,setdata}}>
            {children}
        </mycontext.Provider>
    )
}

export default myprovider
